import React from "react";
import Form from "./components/form.js";

function App() {
  const style = {
    color: "cornflowerblue",
    margin: 15
  }
  const forChild = {
    note: "<em>Good luck out there my child!</em>"
  }
  return (
    <div>
      <div style={style}> 'Sup, Planet Earth? </div>
      <Form fromParent={forChild.note}/>
    </div>
  )
}

export default App;
